function orbitalPeriod(arr) {
  var GM = 398600.4418;
  var earthRadius = 6367.4447;

  let finalArr = [];

  for(let i = 0; i < arr.length; i++){
    var a = earthRadius + arr[i].avgAlt; 
    var orbPer = 2*Math.PI*Math.sqrt((Math.pow(a,3))/GM);
    finalArr.push({name: arr[i].name, orbitalPeriod: Math.round(orbPer)});
  }

  return finalArr;
}

